import React from "react";
import "./sidebar.css";
import logo from "../../assets/logo.png";

const Sidebar = () => {
  return (
    <aside className="aside">
      <a href="#home" className="nav-logo">
        <img src={logo} alt="logo" />
      </a>
    </aside>
  );
};

export default Sidebar;
